import { IonButton, IonButtons, IonCol, IonContent, IonGrid, IonHeader, IonItem, IonLabel, IonList, IonPage, IonRadio, IonRadioGroup, IonRouterLink, IonRow, IonSelect, IonSelectOption, IonTextarea, IonTitle } from '@ionic/react';
import React, { useRef } from 'react';
import { useForm } from 'react-hook-form';

import '../css/Global.css';
import '../css/CommonFaqs.css';

import TopNav from '../components/TopNav';
import Menu from '../components/Menu';


const CommonFaqs: React.FC = () => {
    return(
        <IonPage>
            <IonHeader>
                <TopNav title="Common FAQs" route='/u/usefulInfoMain' backarrow={ true } hamburger = { true }/>
            </IonHeader>

            <IonContent fullscreen={true}>
                <IonGrid id="admissionAppTitleGrid">
                    <IonRow id="admissonAppTitleRow">
                        <IonTitle id="admissionAppTitle">How to Apply</IonTitle>
                    </IonRow>
                    
                </IonGrid>
            </IonContent>

        </IonPage>
    );

};

export default CommonFaqs;
